import { useReducer, useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

export default function ConsumerReg() {
    const init = {
        username : {value:"",valid:false,touched:false,error:""},
        password :{value:"",valid:false,touched:false,error:""},
        first_name :{value:"",valid:false,touched:false,error:""},
        last_name : {value:"",valid:false,touched:false,error:""},
        email : {value:"",valid:false,touched:false,error:""},
        
        phone_no : {value:0,valid:false,touched:false,error:""},
        area : {value:"",valid:false,touched:false,error:""},
        address : {value:"",valid:false,touched:false,error:""}
        // username: "",
        // password: "",
        // first_name: "",
        // last_name: "",
        // email: "",
        // phone_no: "",
        // area: 0,
        // address:""
    }

    const reducer = (state, action) => {
        switch (action.type) {
            case 'update':
                const {key,value,touched,valid,error}=action.data;
    return {...state,[key]:{value,touched,valid,error}}
            case 'reset':
                return init;
            default:
                return state;
        }
    }

    const [info, dispatch] = useReducer(reducer, init);
       
    
    const [cities, setCities] = useState([]); 
    const [areas, setAreas] = useState([]);
    const [file, setFile] = useState();
    const [msg,setMsg] = useState("");
    const navigate = useNavigate();



    const validateData= (key,val)=>
    {
        let valid = true;
        let error=""
        switch(key)
        {
            case 'username' :
                {
                    var pattern1 = /[a-zA-Z0-9_-]{3,16}$/
    //                     [a-zA-Z0-9_-]: Allows alphanumeric characters (both lowercase and uppercase), underscores, and hyphens.
    // {3,16}: Specifies the minimum and maximum length of the username. In this case, the username must be between 3 and 16 characters long.
                    console.log(val)
                    console.log(pattern1.test(val))
                    if(!pattern2.test(val))
                    {
                        valid = false;
                        error = "Username Allows alphanumeric characters (both lowercase and uppercase), underscores, and hyphens."
                    }
                    else
                    {
                        valid = true;
                        error=""
                    }
                    break
                }
            case 'password' :
                {
                    var pattern2 = /^(?=.*[0-9])(?=.*[a-z])(?=.*[A-Z])(?=.*[@#$%^&+=])(?=\S+$).{8,}$/
                    // Is at least 8 characters long.
                    // Contains at least one digit.
                    // Contains at least one lowercase letter.
                    // Contains at least one uppercase letter.
                    // Contains at least one special character from the provided set.
                    // Does not contain any whitespace characters.
                    console.log(val)
                    console.log(pattern2.test(val))
                    if(!pattern2.test(val))
                    {
                        valid = false;
                        error = "Password should contain at least one character,one digit,one symbol"
                    }
                    else
                    {
                        valid = true;
                        error=""
                    }
                    break
                }
                case 'email':
                    {
                        var pattern3 = /^[\w._]+@[\w-]{5,10}\.[a-z]{2,3}/
                        console.log(val)
                        console.log(pattern3.test(val))
                        if(!pattern3.test(val))
                        {
                            valid = false;
                            error = "Email should be in proper format"
                        }
                        else
                        {
                            valid = true;
                            error=""
                        }
                        break
                    }
                  

        }
        return { valid: valid, error: error}
    }
    
    useEffect(() => {
        fetch("http://localhost:8080/getCities")
        .then(resp => {
            if(resp.ok)
            {
                return resp.json();
            }
            else{
                throw new Error("server error")
            }
        })
        .then(data => setCities(data))
    }, []); 

   const getAreas = (id) => {
      fetch("http://localhost:8080/getAreas?cid="+id)
      .then(resp => {
        if(resp.ok)
            {
                return resp.json();
            }
            else{
                throw new Error("server error")
            }
      })
      .then(obj => setAreas(obj))
      .catch(error => console.log(error.toString()));
   }

    const sendData = (e) => {
        e.preventDefault();
        const reqOptions = {
            method: 'POST',
            headers: { 'content-type': 'application/json' },
            body: JSON.stringify({
                username: info.username,
                password: info.password,
                first_name: info.first_name,
                last_name: info.last_name,
                email: info.email,
                phone_no: info.phone_no,       
                area_id: info.area,
                address: info.address
                
            })
        }
        fetch("http://localhost:8080/consumerreg", reqOptions)
            .then(resp => {
                if (resp.ok) {
                     console.log(resp.status)
                    return resp.json();
                }
                else
                    throw new Error("server error");
            })
            .then(obj => {
                alert("Registration successful, Try Login");
                navigate('/')
            })
            .catch(error => {
                console.error(error);
            });
    }

    return (
        <div>
            <h1> Consumer Registraction </h1>
            <form>
                <div className="mb-3">
                    <label htmlFor="username" className="form-label">Enter User Name :</label>
                    <input type="text" className="form-control" id="username" name="username" value={info.username}  
                    onChange={(e)=>{dispatch({type:'update',fld:'username', val:e.target.value})}}/>
                    <div id="emailHelp" className="form-text"></div>
                </div>
                <div className="mb-3">
                    <label htmlFor="password" className="form-label">Enter Password :</label>
                    <input type="password" className="form-control" id="password" name="password" value={info.password} 
                    onChange={(e)=>{dispatch({type:'update',fld:'password', val:e.target.value})}}/>
                    <div id="pwdHelp" className="form-text">...</div>
                </div>
                <div className="mb-3">
                    <label htmlFor="Shop_name" className="form-label">Enter First Name :</label>
                    <input type="text" className="form-control" id="first_name" name="first_name" value={info.first_name} 
                    onChange={(e)=>{dispatch({type:'update',fld:'first_name', val:e.target.value})}}/>
                    <div id="emailHelp" className="form-text"></div>
                </div>
                
                <div className="mb-3">
                    <label htmlFor="Shop_name" className="form-label">Enter Last Name :</label>
                    <input type="text" className="form-control" id="last_name" name="last_name" value={info.last_name} 
                    onChange={(e)=>{dispatch({type:'update',fld:'last_name', val:e.target.value})}}/>
                    <div id="emailHelp" className="form-text"></div>
                </div>

                <div className="mb-3">
                    <label htmlFor="email" className="form-label">Enter User email :</label>
                    <input type="text" className="form-control" id="email" name="email" value={info.email}  
                    onChange={(e)=>{dispatch({type:'update',fld:'email', val:e.target.value})}}/>
                    <div id="emailHelp" className="form-text"></div>
                </div>
                <div className="mb-3">
                    <label htmlFor="phone_no" className="form-label">Enter User phone_no :</label>
                    <input type="number" className="form-control" id="phone_no" name="phone_no" value={info.phone_no}  
                    onChange={(e)=>{dispatch({type:'update',fld:'phone_no', val:e.target.value})}}/>
                    <div id="emailHelp" className="form-text"></div>
                </div>
                
                <div className="mb-3">
                    <label htmlFor="city" className="form-label">Select City:</label>
                    <select
                        className="form-control"
                        id="city"
                        name="city"
                        value={info.city}
                        onChange={(e)=>getAreas(e.target.value)}>
                        <option value="">Select City</option>
                        {cities.map(city => (
                            <option key={city.city_id} value={city.city_id}>{city.c_name}</option>
                        ))}
                    </select>
                </div>       
                <div className="mb-3">
                    <label htmlFor="area" className="form-label">Select Area:</label>
                    <select
                        className="form-control"
                        id="area"
                        name="area"
                        value={info.area}
                        onChange={(e) => {
                        dispatch({ type: 'update', fld: 'area', val: e.target.value });
                        }}
                    >
                        <option value="">Select Area</option>
                        {areas.map((area) => (
                        <option key={area.area_id} value={area.area_id}>
                            {area.area_name}
                        </option>
                        ))}
                    </select>
                    </div>  

                     <div className="mb-3">
                    <label htmlFor="address" className="form-label">Enter User address :</label>
                    <input type="text" className="form-control" id="address" name="address" value={info.address}  
                    onChange={(e)=>{dispatch({type:'update',fld:'address', val:e.target.value})}}/>
                    <div id="emailHelp" className="form-text"></div>
                </div>  
                
                <button type="submit" className="btn btn-primary mb-3" onClick={(e)=> {sendData(e)}}>Submit</button>
                <button type="reset" className="btn btn-primary mb-3" onClick={()=>{dispatch({type:'reset'})}}>Clear</button>
            </form>
             <p>{JSON.stringify(info)}</p>
            <p>{msg}</p> 
        </div>
    )
}
